		<style>

				margin-bottom: 40px;
			}

				font-family: arial, sans-serif;
				line-height: 1.2em;
				margin-bottom: 1em;
			}
			
			a {
				color: #3263c0;
				text-decoration: none;
				cursor: pointer;
			}
			
			@media only screen and (max-width: 600px) {
				
				body {
					font-size: 16px;
				}
				
				h1 {
					font-size: 1.5rem
				}
			}
		</style>
